import React from 'react';
import { Card } from 'antd';
import { RetweetOutlined, HeartOutlined, MessageOutlined, Popover} from '@ant-design/icons';
const PostCard = ({post}) => {

    return (
        <div>
            <Card
                cover={post.Image[0] && <PostImages images={post.images} />}
                actions={[
                    <RetweetOutlined />,
                    <HeartOutlined />,
                    <MessageOutlined />,
                    <Popover/>


                ]}
            >
                <Image />
                <Content/>
            </Card>
            <CommentForm />
            <Contents/>
        </div>
    )
}

export default PostCard
